import { React, useState } from "react";
import { NavLink } from "react-router-dom"
//styles
import '../styles/nav.css';

const Nav = () => {
    const [expanded, setExpanded] = useState(false);
    const { location: { pathname } } = this.props;

    console.log(pathname)

    const setNavExpanded = () => {
        setExpanded(true);
        console.log('open', expanded)
    }

    const setNavCollapsed = () => {
        setExpanded(false);
        console.log('close', expanded)
    }

    return (
        <nav className='nav' expanded={expanded}>
            <NavLink to="/" exact='true' className='nav-title' onClick={setNavExpanded}>
                Jaime Castaneda
            </NavLink>
            <div className="nav-social">
                <a href="https://www.linkedin.com/in/jaime-castaneda-956154a8/">
                    Linkedin
                </a>
                <a href="https://www.instagram.com/the_casta_way/">
                    Instagram
                </a>
                <a href="https://twitter.com/the_casta_way">
                    Threads
                </a>
            </div>
            <div className="nav-links">
                <NavLink to="/showcase" exact='true' style={({ isActive, isPending }) => {
                    return {
                        color: isActive ? "Blue" : "#DCDCDC",
                    };
                }} onClick={setNavCollapsed}>
                    Showcase
                </NavLink>
                <NavLink to="/about" exact='true' style={({ isActive, isPending }) => {
                    return {
                        color: isActive ? "Blue" : "#DCDCDC",
                    };
                }} onClick={setNavCollapsed}>
                    About
                </NavLink>
                <a href="mailto:jccd.designs@gmail.com">
                    Contact
                </a>
            </div>
        </nav>
    );
}

export default Nav;
